import React from 'react'

export class TodoForm extends React.Component {
    render() {
        return (
            <div>
                <div className="todo type1">
                    <form className="input-wrapper">
                        <input id="todoInput" type="text" className="add-todo"/>
                    </form>
                </div>
                <button type="" className="add-btn"/>
            </div>
        )
    }
}
